import unittest
from src.Logic import Cifrador as Cifrador


class CifradoTest(unittest.TestCase):

    # Pruebas normales de cifrado
    def test_cifrado_correctamente(self):
        mensaje = "Hola Mundo"
        clave = 5678
        mensaje_cifrado = "iOe3AaKoBBBmHWX+JGbsTw=="
        resultado = Cifrador.cifrar(mensaje, clave)
        self.assertEqual(mensaje_cifrado, resultado)

    def test_cifrar_mensaje_corto(self):
        mensaje = "HolaMundo"
        clave = 2343
        mensaje_cifrado = "1zE+Mx7Oi7OSfYrknIZnkg=="
        resultado = Cifrador.cifrar(mensaje, clave)
        self.assertEqual(mensaje_cifrado, resultado)

    def test_cifrar_mensaje_512_bits(self):
        mensaje = "b" * 512
        clave = "12345"
        mensaje_cifrado = ""
        resultado = Cifrador.cifrar(mensaje, clave)
        self.assertEqual(mensaje_cifrado, resultado)

    # Pruebas extraordinarias de cifrado
    def test_cifrar_mensaje_largo(self):
        mensaje = "b" * 20000
        clave = "4564"
        mensaje_cifrado = ""
        resultado = Cifrador.cifrar(mensaje, clave)
        self.assertEqual(mensaje_cifrado, resultado)

    def test_cifrar_mensaje_caracteres_especiales_numeros(self):
        mensaje = "H%$56"
        clave = "4321"
        mensaje_cifrado = "boRl4SqsqJNsedsBta66HA=="
        resultado = Cifrador.cifrar(mensaje, clave)
        self.assertEqual(mensaje_cifrado, resultado)

    def test_cifrar_mensaje_emojis(self):
        mensaje = "😈😉😊😋😌😍😎😏"
        clave = "1245"
        mensaje_cifrado = "4prLpxLPhWA3ZFADfYLbEOK+6zYdFTkh9JvQ836A7FSVQxKJTvZxMTox7Yce1nnt"
        resultado = Cifrador.cifrar(mensaje, clave)
        self.assertEqual(mensaje_cifrado, resultado)

    # Casos de error cifrado
    def test_cifrar_sin_clave(self):
        mensaje = "Hola Como Estas"
        clave = ""

        try:
            if not clave:
                raise ValueError("El mensaje no puede encriptar sin clave")
        # Aquí iría el resto del código de cifrado
        except ValueError as e:
            print(f"Error: {e}")


    def test_cifrar_mensaje_vacio(self):
        mensaje = "" or None
        clave = "123"

        try:
            if not mensaje:
                raise ValueError("El mensaje no puede estar vacío o ser None")
        # Aquí iría el resto del código de cifrado
        except ValueError as e:
            print(f"Error: {e}")


    def test_cifrar_lista(self):
        mensaje = ["Hola", 6]
        clave = "1234"

        try:
            if mensaje == list:
                raise ValueError("No se puede encriptar una lista")
        # Aquí iría el resto del código de cifrado
        except ValueError as e:
            print(f"Error: {e}")


    def test_entero_real(self):
        mensaje = 123
        clave = "3567"

        try:
            if mensaje == int:
                raise ValueError("El mensaje no puede encriptar un entero, ni otro tipo de dato que no sea un string")
        # Aquí iría el resto del código de cifrado
        except ValueError as e:
            print(f"Error: {e}")


    # Pruebas normales de descifrado
    def test_esta_cifrado(self):
        mensaje = "iOe3AaKoBBBmHWX+JGbsTw=="
        clave = "5678"
        mensaje_descifrado = "Hola Mundo"
        mensaje_cifrado = Cifrador.cifrar(mensaje, clave)
        self.assertTrue(Cifrador.esta_cifrado(mensaje_cifrado))

    def test_descifrar_mensaje_simple(self):
        mensaje = "1zE+Mx7Oi7OSfYrknIZnkg=="
        clave = "2343"
        mensaje_descifrado = "HolaMundo"
        resultado = Cifrador.descifrar(mensaje, clave)
        self.assertEqual(mensaje_descifrado, resultado)

    def test_descifrar_mensaje_512_bits(self):
        mensaje = ""
        clave = "12345"
        mensaje_descifrado = "b" * 512
        resultado = Cifrador.descifrar(mensaje, clave)
        self.assertEqual(mensaje_descifrado, resultado)

    #Pruebas extraordinarias descifrado
    def test_descifrar_mensaje_largo(self):
        mensaje = ""
        clave = "4564"
        mensaje_descifrado = "b" * 20000
        resultado = Cifrador.descifrar(mensaje, clave)
        self.assertEqual(mensaje_descifrado, resultado)

    def test_descifrar_mensaje_otros_alfabetos(self):
        mensaje = "N9ecJ+cegVWWJhwDDM7dSg3ruucVKIEhJ1dmXuceQeNtg9KoVCfwK67jblmpGI2z"
        clave = "1334"
        mensaje_descifrado = "Hello, ¡Hola!, 你好, مرحب"
        resultado = Cifrador.descifrar(mensaje, clave)
        self.assertEqual(mensaje_descifrado, resultado)

    def test_descifrar_mensaje_clave_caracteres_especiales(self):
        mensaje = "pegWHjTh+QNxK0qA019nSg=="
        clave = "!#123$3Kj"
        mensaje_descifrado = "Mi clave"
        resultado = Cifrador.descifrar(mensaje, clave)
        self.assertEqual(mensaje_descifrado, resultado)

    # Casos de error descifrado

    def test_descifrar_mensaje_no_cifrado(self):
        mensaje = "nu80"
        clave = "78"
        mensaje_descifrado = "No se puede descifrar"

        try:
            # Simulamos la verificación de si el mensaje está cifrado
            if not mensaje.esta_cifrado(mensaje):
                raise ValueError("El mensaje no está cifrado")
            # Aquí iría el código real de descifrado si el mensaje estuviera cifrado
        except ValueError as e:
            print(f"Error: {e}")
            mensaje_descifrado = "No se puede descifrar"

            print(f"Mensaje descifrado: {mensaje_descifrado}")

    def test_descifrar_clave_vacia(self):
        mensaje = "cYPKAEiAO1kzbWOZDODyv3GDygBIgDtZM21jmQzg8r9xg8oASIA7WTNtY5kM4PK"
